import React, { useState } from "react";
import Navbar2 from "../../components/Navbar/navbar2";
import TM from "../../common/assets/form.svg";
import "./Features.css";
import { useEffect } from "react";
import { useParams } from "react-router-dom";
import {fetchBoxPlots} from "../../services/glassclassificationservices"
import {
  HeroBtnWrapper,
  ArrowForward,
  ArrowRight,
} from "../../components/HeroSection/HeroElements";
import { Button } from "../../components/ButtonElement";
import CircularProgress from "@mui/material/CircularProgress";
import Box from "@mui/material/Box";
import {
  FeaturesRow,
  FeaturesColumn,
  TextWrapper,
  Img,
  TopLine,
  FeaturesSec,
  FeaturesContainer,
  ImgWrapper,
  Table,
  FeatureWrap,
} from "./Features.elements";
import Collapse from "rc-collapse";
var Panel = Collapse.Panel;
require("rc-collapse/assets/index.css");

const CreateNewContract = ({ lightTopLine }) => {
  const params = useParams();
  const [hover, setHover] = useState(false);
  const [imageSrc, setImageSrc] = useState(null);
  const [loading, setLoading] = useState(true);
  console.log("param details", params["param"]);
  const onHover = () => {
    setHover(!hover);
  };


 


  return (
    <>
      <Navbar2 />
      <FeaturesSec>
      <h1>Glass Type Classification from Images</h1>
      
    </FeaturesSec>
    </>
  );
};

export default CreateNewContract;
